import {combineReducers} from "redux";
import cartReducer from "./cartReducer/reducer";
import { ShopReducer } from "./shopReducer/reducer";


const rootReducer = combineReducers({
    cart:cartReducer,
shop:ShopReducer
});

export default rootReducer;
